import React, { Component } from "react";
import "./About.css";

export class About extends Component {
  render() {
    return (
      <div className="about-whole">
        <div className="jumbotron jumbotron-fluid jumbotron-about">
          <div className="container"></div>
        </div>
        <div className="container abouttext">
          <div className="row">
            <div className="col">
              <div className="abouttext">zhopa</div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
